function initGIS() {
	var graphMapName = "";// extractUrlParams(window.location.search)['id'];
	// var serverURL = "http://192.168.1.30:8405/locations/";

	var mazenayLat = 46.9033543;
	var mazenayLong = 4.5959406;

	var nolayLat = 46.9033543;
	var nolayLong = 4.5959406;

	var meursaultLat = 46.9033543;
	var meursaultLong = 4.5959406;

	

	var map = L.map('map').setView([ mazenayLat, mazenayLong, 50 ], 12);

	var osmUrl = 'https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png';
	
	//osmUrl ='https://{a|b|c}.tile.opentopomap.org/{z}/{x}/{y}.png'
	var osmAttrib = 'Map data © <a href="https://openstreetmap.org">OpenStreetMap</a> contributors';
	var osm = new L.TileLayer(osmUrl, {
		maxZoom : 18,
		attribution : osmAttrib
	});
	map.addLayer(osm);

	L.Control.Watermark = L.Control.extend({
		onAdd : function(map) {
			var button = L.DomUtil.create('input');

			button.type = "button";
			button.value = "Add locations"
			button.onclick = function(evt) {
				addLocations()
			};
			// img.style.width = '200px';

			return button;
		},

		onRemove : function(map) {
			// Nothing to do here
		}
	});

	L.control.watermark = function(opts) {
		return new L.Control.Watermark(opts);
	}

	L.control.watermark({
		position : 'bottomleft'
	}).addTo(map);

	var mazenayData = {
		properties : {
			longitude : mazenayLong,
			latitude : mazenayLat,
			locType : "Cave",
			name : "Mazenay"
		}
	};
	addPoint(mazenayData,map);

	/*var diametreEnMetres = 20000;
	L.circle([ mazenayLat, mazenayLong ], diametreEnMetres).addTo(map);
	var data = getData();
	for (i = 0; i < data.length; i++) {
		var point = data[i];
		point.properties.locType = "Cave";
		addPoint(point,map);
	}*/
	
	var originalData = getParcelData();
	var filteredData =  [];
	
	for (i = 0 ; i < originalData.length ; i++){
		
		if (!originalData[i].properties.new_nomcom){
			
		}
		else if (originalData[i].properties.new_nomcom){
			filteredData.push (originalData[i]);
			//console.log ()
		}
	}
	
	L.geoJSON(filteredData, {
	    style: function (feature) {
	        //return {color: feature.properties.color,stroke:true};
	    	if (feature.properties.denomination.includes ("premier cru")){
	    		return {color: "#0000FF",stroke:true,fillRule:"nonzero"};
	    	}
	    	else 
	    	return {color: "#FF0000",stroke:true,fillRule:"nonzero"};
	    }
	}).bindPopup(function (layer) {
	    return "Appellation : "+layer.feature.properties.appellation
	    +"<br/> Dénomination : "+layer.feature.properties.denomination
	    +"<br/> Type : "+layer.feature.properties.type_ig
	    +"<br/> Commune : "+layer.feature.properties.new_nomcom
	    +"<br/> "+layer.feature.properties.crinao;
	}).addTo(map);
	
	
}

function addPoint(data, map) {
	var longitude = data.properties.longitude;
	var latitude = data.properties.latitude;
	console.log("put data " + data);
	try {
		L.marker([ latitude, longitude ]).addTo(map).bindPopup(
				'Location type: ' + data.properties.locType + '<br> Name: '
						+ data.properties.name + '<br> Description: '
						+ data.properties.geoDescription);
	} catch (exception) {
		console.log("Error on mark");
		console.log(exception);
	}

	// .openPopup();
}

